erence.\\n\\nMichael Welp, PhD. is a co-founder of White Men as Full Diversity Partners (WMFDP). For 20 years, Welp has led pioneering workshops engaging white male leaders to create cultures of full inclusion. He focuses on how to engage white men to become more passionate advocates for inclusion and how they can partner better with people of color and white women. Welp has facilitated interracial team building with over a dozen South African corporations in his work with Outward Bound. His research on how white men learn about diversity led to founding WMFDP. Welp is the author of the recently published book,Four Days To Change: 12 Radical Habits to Overcome Bias and Thrive in a Diverse World.\\n\\nThis talk was given at a TEDx event using the TED conference format but independently organized by a local community. Learn more at https:\/\/www.ted.com\/tedx\",\"isCrawlable\":true,\"thumbnail\":{\"thumbnails\":[{\"url\":\"https:\/\/i.ytimg.com\/vi\/rR5zDIjUrfk\/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLAKPXAMY0KZGAkxk5Rg4wRwiao7aQ\",\"width\":168,\"height\":94},{\"url\":\"https:\/\/i.ytimg.com\/vi\/rR5zDIjUrfk\/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\\u0026rs=AOn4CLCRvooj-PwweNLdNTO1h1iLmsJnhQ\",\"width\":196,\"height\":110},{\"url\":\"https:\/\/i.ytimg.com\/vi\/rR5zDIjUrfk\/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLBo2ihctAFyHdxmCc36j6rUeqZBSQ\",\"width\":246,\"height\":138},{\"url\":\"https:\/\/i.ytimg.com\/vi\/rR5zDIjUrfk\/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\\u0026rs=AOn4CLBvTa9IABitTVzWff2fjaB-NdV3hg\",\"width\":336,\"height\":188},{\"url\":\"https:\/\/i.ytimg.com\/vi\/rR5zDIjUrfk\/maxresdefault.jpg\",\"width\":1920,\"height\":1080}]},\"averageRating\":4.361547,\"allowRatings\":true,\"viewCount\":\"205798\",\"author\":\"TEDx Talks\",\"isPrivate\":false,\"isUnpluggedCorpus\":false,\"isLiveContent\
